import React from 'react';

import logo from '../../assets/logo.svg';
console.log(logo)
const Home = () => {
    return (
       <div id="page-home">
           <div className="content">
                <img src="{logo}" alt="Ecoleta"/>
           </div>
       </div>
    )
}

export default Home;
